import { Component } from '@angular/core';

@Component({
  selector: 'todo',
  templateUrl: './todo.component.html',
  styleUrls: ['./todo.component.css']
})

export class TodoComponent {
  constructor(){}
  private name = "Osman"
  getName(){
    return this.name;
  }
  items =[
    {description: "Get out of bed", done: true},
    {description: "Brush teeth", done: false},
    {description: "Eat breakfast", done: false},
    {description: "Go to work", done: false},
  ]
}
